import React from "react";
import clipboard from "clipboard-copy";

const copy = require("clipboard-copy");

function Card(props) {
  const firstColor = props.firstColor;
  const secondColor = props.secondColor;
  const thirdColor = props.thirdColor;
  const fourthColor = props.fourthColor;

  function testlog() {
    copy("This is some cool text");
    return console.log("test");
  }

  return (
    <div class="card">
      <h2>{props.name}</h2>
      <div>
        <div
          class="color-square"
          onClick={testlog}
          style={{ backgroundColor: firstColor }}
        ></div>
        <p>{firstColor}</p>
      </div>

      <p style={{ backgroundColor: secondColor }}>
        second color: {secondColor}
      </p>
      <p style={{ backgroundColor: thirdColor }}>third color: {thirdColor}</p>
      <p style={{ backgroundColor: fourthColor }}>
        fourth color: {fourthColor}
      </p>
      <button onClick={testlog}></button>
    </div>
  );
}

export default Card;
